          Ease(loadinganim2.sprite.color, 4, 255, 20, \"linear\")\n                        }, 5),\n                        Do(function() loadinganim1.sprite.color[4] = 255 end),\n                        Animate(loadinganim2.sprite, \"loading\"),\n                        PlayAudio(\"sfx\", \"nicolebeep\", 1.0),\n                        Do(function()\n                            loadinganim1:remove()\n                            self.gotit = true\n                        end)\n                    }\n                end),\n                Animate(sprites.sonic.sprite, \"idleup\"),\n                Animate(sprites.sally.sprite, \"idleup\"),\n                Animate(sprites.bunny.sprite, \"idleup\"),\n                YieldUntil(self, \"gotit\"),\n                Animate(sprites.sally.sprite, \"pose\"),\n                Animate(sprites.bunny.sprite, \"idleright\"),\n                Animate(sprites.sonic.sprite, \"idleleft\"),\n                MessageBox {message=\"Sally: Got it! {p60}Let's get outta here!\", textspeed=4},\n\n                -- Hear footsteps getting louder\n                Wait(1),\n                Animate(sprites.sally.sprite, \"idledown\"),\n                Do(function() self.scene.juggerbotstepVolume = 0.8 end),\n                MessageBox {message=\"Bunnie: Wait a second. {p60}Do y'all hear what I'm hearin?\", textspeed=3},\n                Animate(sprites.sally.sprite, \"thinking\"),\n                MessageBox {message=\"Sally: Mhm. {p60}What is that?\", textspeed=3},\n                Animate(sprites.sonic.sprite, \"thinking\"),\n                MessageBox {message=\"Sonic: I've been hearing it since we entered this room.\", textspeed=3},\n                Do(function() self.scene.juggerbotstepVolume = 1.0 end),\n                PlayAudio(\"sfx\", \"openchasm\", 1.0, true),\n                Ease(wallLayer, \"offsety\", -32*3, 1),\n                Do(function()\n                    self.scene.objectLookup.RightEntrance.y = self.scene.objectLookup.RightEntranceBlock.y\n                    self.scene.objectLookup.RightEntrance.object.y = self.scene.objectLookup.RightEntranceBlock.y\n                    self.scene.objectLookup.RightEntrance:updateCollision()\n                    self.scene.objectLookup.RightEntranceBlock:remove()\n                    GameState:setFlag(self.scene.objectLookup.RightEntranceBlock)\n                    GameState:setFlag(\"ep2boss\")\n\n                    local jbot = Juggerbot(\n                        self.scene,\n                        {name=\"objects\"},\n                        {\n                            name = \"JuggerBot\",\n                            x = self.scene.objectLookup.RightEntrance.x + 150,\n                            y = self.scene.objectLookup.RightEntrance.y,\n                            width = 64,\n                            height = 32,\n                            properties = {\n                                defaultAnim = \"idle\",\n                                ghost = true,\n                                sprite = \"art/sprites/juggerbotbody.png\",\n                                ignorePlayer = true\n                            }\n                        }\n                    )\n                    self.scene:addObject(jbot)\n                    self.scene.objectLookup.JBot = jbot\n                    jbot:faceLeft()\n                end),\n\n                Animate(sprites.sonic.sprite, \"idleright\"),\n                Animate(sprites.sally.sprite, \"idleright\"),\n                Animate(sprites.bunny.sprite, \"idleright\"),\n                Ease(self.scene.camPos, \"x\", -150, 1),\n                Wait(1),\n\n                -- Right door opens, see juggerbot\n                Do(function()\n                    local jbot = self.scene.objectLookup.JBot\n                    jbot:run {\n                        jbot:moveAnim(\"left\")\n                    }\n                end),\n                PlayAudio(\"music\", \"robotrouble\", 1.0, true),\n                Wait(1),\n\n                Animate(sprites.sally.sprite, \"shock\"),\n                Animate(sprites.bunny.sprite, \"shock\"),\n                Animate(sprites.sonic.sprite, \"shock\"),\n\n                MessageBox {message=\"Sonic: Uh oh!\", textspeed=3, closeAction=Wait(1)},\n                Parallel {\n                    Wait(3),\n\n                    -- Roar\n                    Animate(function() return self.scene.objectLookup.JBot.head end, \"roar\"),\n                    PlayAudio(\"sfx\", \"juggerbotroar\", 0.2, true),\n                    self.scene:screenShake(10, 30, 24)\n                },\n        \n                self.scene:enterBattle {\n                    opponents = {\n                        \"juggerbot\"\n                    },\n                    music = \"boss\",\n                    bossBattle = true,\n                    beforeBattle = Do(function() self.scene.objectLookup.JBot:remove() end)\n                },\n\n                BlockPlayer {\n                    Do(function()\n                        self.scene.camPos.x = 0\n                        self.scene.player.sprite.visible = false\n                        self.scene.player.dropShadow.hidden = true\n                        self.scene.player.hidekeyhints[tostring(self)] = self\n                    end),\n                    Animate(sprites.sally.sprite, \"idledown\"),\n                    Animate(sprites.bunny.sprite, \"idleright\"),\n                    Animate(sprites.sonic.sprite, \"pose\"),\n                    MessageBox{message=\"Sonic: Yeah! {p40}Hedgehog 'one', Buttnik 'zero'!\", textspeed=4},\n                    Animate(sprites.sally.sprite, \"frustrateddown\"),\n                    MessageBox{message=\"Sally: Sonic! {p60}We need to get out of here!\", textspeed=4},\n                    Animate(sprites.sonic.sprite, \"idleup\"),\n                    MessageBox{message=\"Sonic: Chill Sal, everything's cool. {p60}There's no way Buttnik's got another one of those!\", textspeed=4},\n    \n                    Do(function()\n                        local jbot1 = Juggerbot(\n                            self.scene,\n                            {name=\"objects\"},\n                            {\n                                name = \"JuggerBot1\",\n                                x = self.scene.player.x - 550,\n                                y = self.scene.player.y + 100,\n                                width = 64,\n                                height = 32,\n                                properties = {\n                                    defaultAnim = \"idle\",\n                                    ghost = true,\n                                    sprite = \"art/sprites/juggerbotbody.png\",\n                                    ignorePlayer = true\n                                }\n                            }\n                        )\n                        self.scene:addObject(jbot1)\n                        self.scene.objectLookup.JBot1 = jbot1\n                        jbot1:run {\n                            jbot1:moveAnim(\"right\"),\n                            Wait(1),\n                            jbot1:deployLaserAnim()\n                        }\n                        \n                        local jbot2 = Juggerbot(\n                            self.scene,\n                            {name=\"objects\"},\n                            {\n                                name = \"JuggerBot2\",\n                                x = self.scene.player.x + 550,\n                                y = self.scene.player.y + 100,\n                                width = 64,\n                                height = 32,\n                                properties = {\n                                    defaultAnim = \"idle\",\n                                    ghost = true,\n                                    sprite = \"art/sprites/juggerbotbody.png\",\n                                    ignorePlayer = true\n                                }\n                            }\n                        )\n                        self.scene:addObject(jbot2)\n                        self.scene.objectLookup.JBot2 = jbot2\n                        jbot2:faceLeft()\n                        jbot2:run {\n                            Wait(1),\n                            jbot2:moveAnim(\"left\"),\n                            Wait(1),\n                            jbot2:deployLaserAnim()\n                        }\n                    end),\n            \n                    Animate(sprites.sonic.sprite, \"idleleft\"),\n                    Animate(sprites.sally.sprite, \"idleleft\"),\n                    Animate(sprites.bunny.sprite, \"idleleft\"),\n                    Wait(2),\n\n                    Animate(sprites.sonic.sprite, \"idleright\"),\n                    Animate(sprites.sally.sprite, \"idleright\"),\n                    Animate(sprites.bunny.sprite, \"idleright\"),\n                    Wait(2),\n\n                    Animate(sprites.sonic.sprite, \"shock\"),\n                    Animate(sprites.sally.sprite, \"shock\"),\n                    Animate(sprites.bunny.sprite, \"shock\"),\n\n                    Wait(1),\n                    Animate(sprites.sonic.sprite, \"earnestleft\"),\n                    Animate(sprites.sally.sprite, \"idledown\"),\n                    Animate(sprites.bunny.sprite, \"idleright\"),\n                    MessageBox{message=\"Sonic: Heh heh... {p60}uh... {p60}maybe these ones are friendlier?\", textspeed=4},\n                    \n                    -- Both Roar\n                    -- Get into charging position\n                    Animate(sprites.sally.sprite, \"frustrateddown\"),\n                    MessageBox{message=\"Sally: Sonic!!\"},\n                    Animate(sprites.sonic.sprite, \"crouchright\"),\n                    MessageBox{message=\"Sonic: Alright guys...{p40}juice and jam ti--\", textspeed=4, closeAction=Wait(0.5)},\n\n                    Ease(self.scene.camPos, \"x\", -300, 1),\n                    Do(function()\n                        local jbot2 = self.scene.objectLookup.JBot2\n                        jbot2:run {\n                            jbot2:fleetHurtAnim(),\n                            Do(function() self.scene.nextStep = true end),\n                            Do(function() end)\n                        }\n                    end),\n\n                    YieldUntil(self.scene, \"nextStep\"),\n\n                    Animate(sprites.sonic.sprite, \"idleright\"),\n                    Animate(sprites.sally.sprite, \"idleright\"),\n                    Animate(sprites.bunny.sprite, \"idleright\"),\n\n                    Ease(self.scene.camPos, \"x\", 200, 1),\n                    Do(function()\n                        local jbot1 = self.scene.objectLookup.JBot1\n                        jbot1:run {\n                            jbot1:leonHurtAnim(),\n                            Do(function() self.scene.nextStep2 = true end)\n                        }\n                    end),\n\n                    Animate(sprites.sonic.sprite, \"idleleft\"),\n                    Animate(sprites.sally.sprite, \"idleleft\"),\n                    Animate(sprites.bunny.sprite, \"idleleft\"),\n\n                    YieldUntil(self.scene, \"nextStep2\"),\n                    \n                    Ease(self.scene.camPos, \"x\", 0, 1),\n\n                    Animate(sprites.sonic.sprite, \"idleup\"),\n                    Animate(sprites.sally.sprite, \"idleup\"),\n                    Animate(sprites.bunny.sprite, \"idleup\"),\n                    \n                    Do(function()\n                        local fleet = self.scene.objectLookup.Fleet\n                        fleet.x = self.scene.player.x + 10\n                        fleet.y = self.scene.player.y - 500\n                        fleet.sprite.transform.angle = 0\n                        fleet.sprite.color[4] = 255\n                        fleet.sprite:swapLayer(\"upper\")\n                        fleet.sprite:setAnimation(\"fleetfloat\")\n                        fleet:run {\n                            Ease(fleet, \"y\", fleet.y + 510, 0.2),\n                            Animate(fleet.sprite, \"fleetland\"),\n                            Animate(fleet.sprite, \"fleetidle\")\n                        }\n                    end),\n\n                    Ease(self.scene.camPos, \"y\", 500, 1),\n                    PlayAudio(\"music\", \"meettherebellion\", 1.0, true, true),\n\n                    Do(function()\n                        sprites.sonic.sprite:setAnimation(\"stepback\")\n                        sprites.sally.sprite:setAnimation(\"stepback\")\n                        sprites.bunny.sprite:setAnimation(\"stepback\")\n                        \n                        local fleet = self.scene.objectLookup.Fleet\n                        local leon = self.scene.objectLookup.Leon\n                        local ivan = self.scene.objectLookup.Ivan\n                        local logan = BasicNPC(\n                            self.scene,\n                            {name = \"upper\"},\n                            {\n                                name = \"Logan\",\n                                x = fleet.x,\n                                y = fleet.y,\n                                width = 64,\n                                height = 64,\n                                properties = {nocollision = true, sprite = \"art/sprites/leon.png\", defaultAnim = \"loganfall\"}\n                            }\n                        )\n                        logan.sprite.transform.ox = 30\n                        logan.sprite.transform.oy = 43\n                        logan.sprite.color[4] = 0\n                        self.scene.objectLookup.Logan = logan\n                        self.scene:addObject(logan)\n\n                        logan:run {\n                            Wait(1),\n                            Do(function()\n                                logan.sprite.color[4] = 255\n                                leon.sprite.color[4] = 255\n                                ivan.sprite.color[4] = 255\n                                leon.x = fleet.x\n                                leon.y = fleet.y\n                                leon.sprite.color[4] = 255\n                                leon.sprite:swapLayer(\"upper\")\n                                leon.sprite:setAnimation(\"leonfall\")\n\n                                ivan.x = fleet.x\n                                ivan.y = fleet.y\n                                ivan.sprite:swapLayer(\"upper\")\n                                ivan.sprite:setAnimation(\"ivanfall\")\n\n                                logan.x = fleet.x\n                                logan.y = fleet.y\n                            end),\n                            Parallel {\n                                Serial {\n                                    Ease(logan, \"y\", function() return logan.y - 60 end, 2),\n                                    Ease(logan, \"y\", 1580, 1, \"quad\"),\n                                },\n                                Serial {\n                                    Ease(ivan, \"y\", function() return ivan.y - 60 end, 2),\n                                    Ease(ivan, \"y\", 1550, 1, \"quad\"),\n                                },\n                                Serial {\n                                    Ease(leon, \"y\", function() return leon.y - 60 end, 2),\n                                    Ease(leon, \"y\", 1550, 1, \"quad\"),\n                                },\n                                Ease(ivan, \"x\", function() return ivan.x + 50 end, 1),\n                                Ease(leon, \"x\", function() return leon.x - 70 end, 1),\n                                Ease(logan, \"x\", function() return logan.x - 140 end, 1)\n                            },\n                            Parallel {\n                                Serial {\n                                    Animate(ivan.sprite, \"ivanland\"),\n                                    Animate(ivan.sprite, \"ivancross\")\n                                },\n                                Serial {\n                                    Animate(leon.sprite, \"leonland\"),\n                                    Animate(leon.sprite, \"leonsword\"),\n                                    Wait(1),\n                                    Animate(leon.sprite, \"leonswordaway\"),\n                                    Animate(leon.sprite, \"leonidle\")\n                                },\n                                Serial {\n                                    Animate(logan.sprite, \"loganland\"),\n                                    Animate(logan.sprite, \"loganidle\")\n                                }\n                            }\n                        }\n                    end),\n                    Parallel {\n                        Ease(self.scene.camPos, \"y\", -100, 0.3),\n                        Ease(sprites.sonic, \"y\", function() return sprites.sonic.y + 100 end, 0.5),\n                        Ease(sprites.sally, \"y\", function() return sprites.sally.y + 100 end, 0.5),\n                        Ease(sprites.bunny, \"y\", function() return sprites.bunny.y + 100 end, 0.5),\n                    },\n                    Do(function()\n                        sprites.sonic.sprite:setAnimation(\"idleup\")\n                        sprites.sally.sprite:setAnimation(\"idleup\")\n                        sprites.bunny.sprite:setAnimation(\"idleup\")\n                    end),\n\n                    MessageBox{message=\"Sonic: What!?{p60}... Who are--?{p60} How did--?\", textspeed=4},\n\n                    MessageBox{message=\"Fleet (Bird): We saved your butts-- {p60}that's what we do!\", textspeed=4},\n                    Animate(sprites.sonic.sprite, \"irritated\"),\n                    MessageBox{message=\"Sonic: Who says we needed savin'? {p60}I had everything under control!\", textspeed=4},\n                    Animate(function() return self.scene.objectLookup.Fleet.sprite end, \"fleetsmile\"),\n                    MessageBox{message=\"Fleet (Bird): Riiight, {p20}and the laser about to slice you into tiny little bits was probably all part of your brilliant plan!\"},\n                    MessageBox{message=\"Fleet (Bird): Get sliced into a million pieces and fight Robotnik as a million tiny yous! {p20}Great plan, you'll clearly go far in life.\"},\n                    Do(function() self.scene.objectLookup.Fleet.sprite:setAnimation(\"fleetlaugh\") end),\n                    MessageBox{message=\"Fleet (Bird): Then again, {p40}I can't imagine you getting much tinier than you already are, {p60}shorty.\"},\n\n                    Animate(sprites.sonic.sprite, \"shock\"),\n                    Wait(0.5),\n                    Animate(sprites.sonic.sprite, \"irritated\"),\n                    MessageBox{message=\"Sonic: Shorty!?\"},\n                    Do(function()\n                        local leon = self.scene.objectLookup.Leon\n                        leon.sprite:setAnimation(\"leonwalkdown\")\n                        leon:run {\n                            Ease(leon, \"y\", function() return leon.y  + 60 end, 0.4, \"linear\"),\n                            Do(function() leon.sprite:setAnimation(\"leonidle\") end)\n                        }\n                    end),\n                    MessageBox{message=\"Leon (Lion): Fleet. {p60}Compose yourself.\", textspeed=2},\n                    Do(function()\n                        self.scene.objectLookup.Fleet.sprite:setAnimation(\"fleetidle\")\n                    end),\n                    MessageBox{message=\"Fleet (Bird): Fine, fine.\"},\n                    Do(function()\n                        sprites.sonic.sprite:setAnimation(\"idleup\")\n                    end),\n                    MessageBox{message=\"Leon (Lion): Logan, {p60}are there any other Juggerbots nearby?\", textspeed=2},\n                    Do(function() self.scene.objectLookup.Logan.sprite:setAnimation(\"loganresearch\") end),\n                    MessageBox{message=\"Logan (Pig): Scanning...\", textspeed=3},\n                    Animate(sprites.sally.sprite, \"thinking\"),\n                    MessageBox{message=\"Sally: Excuse me, but who are you people?\"},\n                    Do(function()\n                        self.scene.objectLookup.Leon.sprite:setAnimation(\"leonadjust\")\n                    end),\n                    MessageBox{message=\"Leon (Lion): We call ourselves {h the Rebellion}.\", textspeed=2},\n                    Parallel {\n                        MessageBox{message=\"Leon (Lion): I am the leader of this group... {p60}and I was once the leader of your father's {h royal guard}...\", textspeed=2},\n                        AudioFade(\"music\", 1.0, 0.0, 0.3),\n                    },\n                    PlayAudio(\"music\", \"sallymeetsleon\", 1.0, true),\n                    MessageBox{message=\"Leon (Lion): It's a pleasure to see you again, {p40}Princess Sally.\", textspeed=2},\n\n                    Animate(sprites.sonic.sprite, \"shock\"),\n                    Animate(sprites.sally.sprite, \"shock\"),\n                    Animate(sprites.bunny.sprite, \"shock\"),\n                    Wait(1),\n                    Animate(sprites.sonic.sprite, \"idleup\"),\n                    Animate(sprites.sally.sprite, \"idleup\"),\n                    Animate(sprites.bunny.sprite, \"idleup\"),\n\n                    MessageBox{message=\"Bunnie: Oh my stars!\", textspeed=4},\n                    MessageBox{message=\"Sally: O-{p20}Of course!... {p60}Commander Leon...\", textspeed=4},\n\n                    Animate(sprites.sonic.sprite, \"thinking\"),\n\n                    MessageBox{message=\"Sonic: Royal guard?\", textspeed=4},\n                    Do(function()\n                        self.scene.objectLookup.Leon.sprite:setAnimation(\"leonidle\")\n                    end),\n                    MessageBox{message=\"Leon (Lion): I know it's a lot to process, {p40}but the time for explanation comes later. {p60}We must make our escape before the {h good doctor} becomes aware of our presence...\", textspeed=2},\n                    Wait(0.5),\n                    Animate(sprites.sally.sprite, \"idledown\"),\n                    MessageBox{message=\"Sally: H-{p30}He's right.\", textspeed=4},\n                    Animate(sprites.sally.sprite, \"idleup\"),\n                    Animate(sprites.sonic.sprite, \"idleup\"),\n                    MessageBox{message=\"Sally: Leon, {p40}if you follow us, we can lead you to\\n{h Knothole}. {p60}You and your team will be safe there.\", textspeed=4},\n                    Animate(sprites.sonic.sprite, \"idleleft\"),\n                    MessageBox{message=\"Sonic: Whoah, Sal! {p40}*whisper* Are you sure we can trust these guys?\", textspeed=3},\n                    Animate(sprites.sally.sprite, \"idledown\"),\n                    Animate(sprites.bunny.sprite, \"idleright\"),\n                    MessageBox{message=\"Sally: *whisper* I believe he is who he says he is. {p60}And if Leon trusts the others then I trust them too.\", textspeed=3},\n                    MessageBox{message=\"Bunnie: *whisper* Well that's good enough for me, \\nSally-girl.\", textspeed=3},\n                    MessageBox{message=\"Sally: *whisper* Sonic?\", textspeed=3}, \n                    Animate(sprites.sonic.sprite, \"irritated\"),\n                    MessageBox{message=\"Sonic: ...\", textspeed=3},\n                    \n                    Do(function() self.scene.objectLookup.Logan.sprite:setAnimation(\"loganresearchshow\") end),\n                    MessageBox{message=\"Logan (Pig): Um, {p40}not trying to rush you guys, but...\"},\n                    PlayAudio(\"music\", \"robotropolis\", 1.0, true),\n                    MessageBox{message=\"